import React from 'react';
import './List.css';

export default function List(props) {
    return (
      <section className="List">
        <header className="List-header">
          <h2>{props.header}</h2>
        </header>
        <div class="List-cards">
          {this.props.cards}
        </div>
      </section>
    )
  }
